/*Table structure for table `allocationstatus` */

DROP TABLE IF EXISTS `allocationstatus`;

CREATE TABLE `allocationstatus` (
  `statusid` int(11) NOT NULL AUTO_INCREMENT,
  `allocationid` int(11) DEFAULT NULL,
  `containerdeportid` int(11) DEFAULT NULL,
  `cargodeliverystatus` varchar(50) DEFAULT NULL,
  `returndeportstatus` varchar(50) DEFAULT NULL,
  `qurantee` varchar(50) DEFAULT NULL,
  `deliveryinterchange` varchar(50) DEFAULT NULL,
  `clientinterchange` varchar(50) DEFAULT NULL,
  `dateadded` date DEFAULT NULL,
  `addedby` int(11) DEFAULT NULL,
  `deleted` tinyint(1) DEFAULT 0,
  `datedeleted` date DEFAULT NULL,
  `deletedby` int(11) DEFAULT NULL,
  PRIMARY KEY (`statusid`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COLLATE=latin1_swedish_ci;

