/* Procedure structure for procedure `sp_approvebills` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_approvebills` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_approvebills`(`$billid` INT, `$userid` INT, `$approvallevels` VARCHAR(50))
BEGIN

      

        if $approvallevels = 'Level 1' then

               

               update `billing` 

               set `level1state` ='Approved',`level1user`=$userid,`level1date`=now()

               where `billid`=$billid;

               

        ELSEIF $approvallevels = 'Level 2' THEN 

         

               UPDATE `billing` 

               SET `level2state` ='Approved',`level2user`=$userid,`level2date`=NOW()

               WHERE `billid`=$billid;

               

               

         ELSEIF $approvallevels = 'Level 3' THEN

         

               UPDATE `billing` 

               SET `level3state` ='Approved',`level3user`=$userid,`level3date`=NOW()

               WHERE `billid`=$billid;

               

         end if;

    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_approveleave` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_approveleave` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_approveleave`(`$applicationid` INT, `$approvallevelid` INT, `$approvalstatus` VARCHAR(50), `$narration` VARCHAR(1000), `$userid` INT, `$platform` VARCHAR(50))
BEGIN

		start transaction;

			insert into `leaveapproval`(`applicationid`,`approvallevelid`,`approvaluser`,`narration`,`status`,`statusdate`)

			values($applicationid,$approvallevelid,$userid,$narration,$approvalstatus,now());

			

			select concat('Approved leave application of leave, id ',$applicationid,' for level id:',

			$approvallevelid,', levelname:',

				case approvallevel when 'supervisor' then 'Supervisor'

				when 'hrmanager' then 'Human Resource Manager'

				when 'topmanagement' then 'Senior management' end)

			into @narration

			from `leaveapprovallevels` where `id`=$approvallevelid;

			

			CALL `sp_saveaudittrailentry`($userid,'insert',@narration,$platform,'','',NULL);

		commit;

	END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_approveloanpreapplicationlevel` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_approveloanpreapplicationlevel` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_approveloanpreapplicationlevel`(`$id` INT, `$userid` INT, `$amount` NUMERIC)
BEGIN

    DECLARE currentlevel VARCHAR(10);

    -- Determine which level is currently "pending"

    SELECT CASE

               WHEN level1state = 'pending' THEN 'level1'

               WHEN level2state = 'pending' THEN 'level2'

               WHEN level3state = 'pending' THEN 'level3'

               ELSE NULL

           END

    INTO currentlevel

    FROM loanpreapplication

    WHERE id = $id;

    -- If level 1 is pending, approve level 1 and set level 2 to pending

    IF currentlevel = 'level1' THEN

        UPDATE loanpreapplication

        SET level1state = 'approved', level1user = $userid, level1amount = $amount,

            level2state = 'pending', level1date = NOW(), loanlevel = 2

        WHERE id = $id;

    -- If level 2 is pending, approve level 2 and set level 3 to pending

    ELSEIF currentlevel = 'level2' THEN

        UPDATE loanpreapplication

        SET level2state = 'approved', level2user = $userid, level2amount = $amount,

            level3state = 'pending', level2date = NOW(), loanlevel = 3

        WHERE id = $id;

    -- If level 3 is pending, approve level 3

    ELSEIF currentlevel = 'level3' THEN

        UPDATE loanpreapplication

        SET level3state = 'approved', level3user = $userid, level3amount = $amount,

            level3date = NOW()

        WHERE id = $id;

    END IF;

    

END */$$
DELIMITER ;

