/* Procedure structure for procedure `sp_deletefinancialperiod` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_deletefinancialperiod` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_deletefinancialperiod`(`$id` INT, `$userid` INT, `$platform` VARCHAR(1000))
BEGIN

    -- Declare a local variable for the narration

    DECLARE $narration VARCHAR(1000);

    -- Mark the financial period as deleted

    UPDATE `financialperiods` 

    SET `deleted` = 1, 

        `datedeleted` = NOW(), 

        `deletedby` = $userid

    WHERE `id` = $id;

    

    -- Generate the narration message

    SELECT CONCAT('Deleted financial period ', label, ' date range ', 

                  DATE_FORMAT(startdate, '%d-%b-%Y'), '-', DATE_FORMAT(enddate, '%d-%b-%Y'))

    INTO $narration

    FROM `financialperiods`

    WHERE `id` = $id;

    

    -- Save audit trail entry

    CALL `sp_saveaudittrailentry`($userid, 'Delete', $narration, $platform, '', '');

END */$$
DELIMITER ;

