/* Procedure structure for procedure `sp_filterchargeableitems` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_filterchargeableitems` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_filterchargeableitems`(`$category` VARCHAR(50))
BEGIN

		if $category='all' then

			select * from `chargeableitems`

			where `deleted`=0

			order by `recurring`, `itemname`;

		else

			select case when $category='recurring' then 1 else 0 end into @recurring;

			SELECT * FROM `chargeableitems`

			WHERE `deleted`=0 and `recurring`=@recurring

			ORDER BY `itemname`;

		end if;

	END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_filtertracker` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_filtertracker` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_filtertracker`(`$startdate` DATE, `$enddate` DATE, `$trackerstatus` VARCHAR(50))
BEGIN
	SELECT a.allocationid,deliveryorderno,v.trucknumber,dateout,destination,c.clientname,containernumber,'' containerdeport,'' deliverystatus,
	'' containerreturn,'' guarantee,'' interchangecollection,CASE invoiced WHEN 1 THEN 'Yes' ELSE 'No' END invoiced,'' chequestatus,'' interchangereturn,remarks comments,
	`cargodeliverystatus`,`returndeportstatus`,`qurantee`,`deliveryinterchange`,s.`clientinterchange`,`deportname`
	FROM `allocations` a
	INNER JOIN  `allocationdetails` AS ad ON ad.`allocationid`=a.`allocationid`      
	INNER JOIN `drivers` d ON d.`driverid`=ad.`driverid`
	INNER JOIN `clients` c ON c.`clientid`=a.`clientid`
	INNER JOIN `containers` t ON t.`containerid`=a.`containerid`
	INNER JOIN `vehicles` AS v ON v.`vehicleid`=ad.`truckid`
	left join `allocationstatus` s on s.`allocationid` = a.`allocationid`
	LEFT join `containerdepot` r on r.`deportid` = s.`containerdeportid`
	WHERE ad.`dateout` BETWEEN $startdate AND $enddate AND a.`deleted`=0;
    END */$$
DELIMITER ;

