/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_getaccountmapping`()
BEGIN

          select `mappingid`,`accountid`,m.`itemid`,`itemname`,`accountname`,concat(`firstname`,' ',`middlename`,' ',`lastname`) as username

          from `mappingaccount` m

          inner join `glaccounts` g on g.`id` = m.`accountid`

          inner join `chargeableitems` c on c.`itemid` = m.`itemid`

          inner join `user` u on u.`userid`= m.`addedby`

          where m.`deleted`=0

          order by `itemname` asc;

          

    END */$$
