		SELECT c.clientid,a.deliveryorderno,ad.`dateout`,a.`destination`,a.`containernumber`,a.`exchangerate`,cs.`currencyname`,c.`address`,a.amount,`currencyid`
		FROM allocations a
		JOIN clients c ON  c.clientid = a.clientid
		JOIN `allocationdetails` ad ON ad.`allocationid` = a.`allocationid`
		JOIN `currency` cs ON cs.`currencyid` = a.`currency`  
		WHERE a.clientid = $clientid
		and `invoiced` = 0;
		
END */$$
