DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_getallinvoicedclientsdetails`(`$clientid` INT)
BEGIN
	SELECT i.`invoiceid`, invoiceno,c.clientid,c.`clientname`,i.`invoicedate`, sum(id.`amount`) invoiceamount,
	IFNULL((SELECT SUM(amount) from `receiptdetails` rd INNER JOIN `receipts` r on r.`receiptid`=rd.`receiptid` where `invoiceno`=i.`invoiceno` and `clientid`=c.`clientid` and r.`deleted`=0),0) amountpaid,
	sum(id.`amount`)- IFNULL((SELECT SUM(amount) FROM `receiptdetails` rd INNER JOIN `receipts` r ON r.`receiptid`=rd.`receiptid` WHERE `invoiceno`=i.`invoiceno` AND `clientid`=c.`clientid` AND r.`deleted`=0),0) amountdue,
	0 payment
	FROM `invoices` AS i
	INNER JOIN `clients` AS c ON i.`clientid` = c.`clientid`
	INNER JOIN `invoicedetails` AS id ON i.`invoiceid` = id.`invoiceid`
	where i.`clientid` = $clientid
	GROUP BY i.`invoiceid`, invoiceno,c.clientid,c.`clientname`,i.`invoicedate`
	having sum(id.`amount`)- IFNULL((SELECT SUM(amount) FROM `receiptdetails` rd INNER JOIN `receipts` r ON r.`receiptid`=rd.`receiptid` WHERE `invoiceno`=i.`invoiceno` AND `clientid`=c.`clientid` AND r.`deleted`=0),0)>0;
    END */$$
