DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_getclientinvoicesummary`()
BEGIN

	SELECT `clientid`,`codename`,

	IFNULL((SELECT COUNT(i.`invoiceid`) FROM `invoices` i JOIN `invoicedetails` id ON id.`invoiceid`=i.`invoiceid` 

	WHERE `deleted`=0 AND `clientid`=c.`clientid`),0) totalinvoiced,

	IFNULL((SELECT COUNT(i.`invoiceid`) FROM `invoices` i JOIN `invoicedetails` id ON id.`invoiceid`=i.`invoiceid` 

	WHERE `deleted`=0 AND `clientid`=c.`clientid` AND i.`invoiceid` NOT IN (SELECT invoiceno FROM `receiptdetails` rd JOIN `receipts` r ON r.`receiptid`=rd.`receiptid` WHERE `deleted`=0)),0) invoiced,

	IFNULL((SELECT COUNT(`allocationid`) FROM `allocations` WHERE `invoiced`=0 AND `deleted`=0 AND `clientid`=c.`clientid`),0) allocated

	FROM `clients` c

	WHERE `deleted`=0;

    END */$$
