/* Procedure structure for procedure `sp_getclientsbalances` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_getclientsbalances` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_getclientsbalances`()
BEGIN

	SELECT codename,SUM(amount-receipts) balance FROM (

		SELECT i.`invoiceid`,`invoiceno`,`invoicedate`,i.`clientid`,`codename`,`currency`,`rate`,

		IFNULL((SELECT CASE `tax` WHEN 1 THEN SUM(`amount`)+SUM(`amount`*taxrate/100) ELSE SUM(`amount`) END FROM `invoicedetails` WHERE `invoiceid` = i.`invoiceid` GROUP BY `tax`),0) amount,

		IFNULL((SELECT SUM(`amount`) FROM `receiptdetails` rd JOIN `receipts` r ON r.`receiptid`=rd.`receiptid` WHERE `invoiceno`=i.`invoiceid` AND `deleted`=0),0) receipts

		FROM `invoices` i JOIN `clients` c ON c.`clientid`=i.`clientid`

		WHERE i.`deleted`=0

		AND IFNULL((SELECT CASE `tax` WHEN 1 THEN SUM(`amount`)+SUM(`amount`*taxrate/100) ELSE SUM(`amount`) END FROM `invoicedetails` WHERE `invoiceid` = i.`invoiceid` GROUP BY `tax`),0) -

		IFNULL((SELECT SUM(`amount`) FROM `receiptdetails` rd JOIN `receipts` r ON r.`receiptid`=rd.`receiptid` WHERE `invoiceno`=i.`invoiceid` AND `deleted`=0),0)>0)

	AS XXX

	GROUP BY codename;

    END */$$
