/* Procedure structure for procedure `sp_getfilteredallocation` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_getfilteredallocation` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_getfilteredallocation`(IN `startdate` DATE, IN `enddate` DATE, IN `$allocationstatus` VARCHAR(50))
BEGIN	

	

	if $allocationstatus = 'all' THEN 

	

		SELECT a.allocationid,deliveryorderno, CONCAT(`firstname`,' ',`lastname`) drivername,c.clientid,c.clientname,destination,c.address,c.telephone,particular,route,containername,

		containernumber,v.trucknumber,v.trailerno,dateout,expecteddate expecteddatein,remarks,statusremarks,`actualdate`

		FROM `allocations` a

		inner JOIN  `allocationdetails` AS ad ON ad.`allocationid`=a.`allocationid`      

		inner JOIN `drivers` d ON d.`driverid`=ad.`driverid`

		inner JOIN `clients` c ON c.`clientid`=a.`clientid`

		inner JOIN `containers` t ON t.`containerid`=a.`containerid`

		inner JOIN `vehicles` AS v ON v.`vehicleid`=ad.`truckid`

		WHERE ad.`dateout` BETWEEN startdate AND enddate and a.`deleted`=0;

	ELSE

	      	SELECT a.allocationid,deliveryorderno, CONCAT(`firstname`,' ',`lastname`) drivername,c.clientid,c.clientname,destination,c.address,c.telephone,particular,route,containername,

		containernumber,v.trucknumber,v.trailerno,dateout,expecteddate expecteddatein,remarks,statusremarks,`actualdate`

		FROM `allocations` a

		INNER JOIN  `allocationdetails` AS ad ON ad.`allocationid`=a.`allocationid`      

		INNER JOIN `drivers` d ON d.`driverid`=ad.`driverid`

		INNER JOIN `clients` c ON c.`clientid`=a.`clientid`

		INNER JOIN `containers` t ON t.`containerid`=a.`containerid`

		INNER JOIN `vehicles` AS v ON v.`vehicleid`=ad.`truckid`

		WHERE ad.`dateout` BETWEEN startdate AND enddate AND a.`deleted`=0 AND ad.`truckstatus` = $allocationstatus;

		

	END IF;

    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_getfilteredinvoices` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_getfilteredinvoices` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_getfilteredinvoices`(IN `$clientid` INT, IN `$startdate` DATE, IN `$enddate` DATE, IN `$currency` INT, IN `$invstatus` VARCHAR(50), IN `$alldates` TINYINT(1))
BEGIN
	IF $alldates=1 THEN
		IF $clientid=0 THEN
			SELECT `invoiceid`,/*`invoiceno`*/
			CASE WHEN `oldinvoiceno` IS NULL THEN `invoiceno` 
			ELSE `oldinvoiceno` 
			END AS invoiceno,DATE_FORMAT(`invoicedate`,'%d-%b-%Y') `invoicedate`, i.`clientid`,`currency`,`rate`, 
			c.`clientname`,c.`address`,
			IFNULL((SELECT CASE WHEN tax=1 THEN SUM(amount)+ SUM(amount*0.16) ELSE SUM(amount) END
			FROM `invoicedetails` WHERE invoiceid=i.invoiceid GROUP BY tax),0) amount
			FROM `invoices` AS i INNER JOIN `clients` AS c ON i.`clientid` = c.`clientid`
			WHERE i.`deleted`=0
			ORDER BY `invoiceid` DESC;
		ELSE
			SELECT `invoiceid`,/*`invoiceno`,*/
			CASE WHEN `oldinvoiceno` IS NULL THEN `invoiceno` 
			ELSE `oldinvoiceno` 
			END AS invoiceno,
			DATE_FORMAT(`invoicedate`,'%d-%b-%Y') `invoicedate`, i.`clientid`,`currency`,`rate`, 
			c.`clientname`,c.`address`,
			IFNULL((SELECT CASE WHEN tax=1 THEN SUM(amount)+ SUM(amount*0.16) ELSE SUM(amount) END
			FROM `invoicedetails` WHERE invoiceid=i.invoiceid GROUP BY tax),0) amount
			FROM `invoices` AS i INNER JOIN `clients` AS c ON i.`clientid` = c.`clientid`
			WHERE i.`deleted`=0 AND i.`clientid`=$clientid
			ORDER BY `invoiceid` DESC;
		END IF;
	ELSE
		IF $clientid=0 THEN
			SELECT `invoiceid`,
			/*`invoiceno`,*/
			CASE WHEN `oldinvoiceno` IS NULL THEN `invoiceno` 
			ELSE `oldinvoiceno` 
			END AS invoiceno,
			DATE_FORMAT(`invoicedate`,'%d-%b-%Y') `invoicedate`, i.`clientid`,`currency`,`rate`, 
			c.`clientname`,c.`address`,
			IFNULL((SELECT CASE WHEN tax=1 THEN SUM(amount)+ SUM(amount*0.16) ELSE SUM(amount) END
			FROM `invoicedetails` WHERE invoiceid=i.invoiceid GROUP BY tax),0) amount
			FROM `invoices` AS i INNER JOIN `clients` AS c ON i.`clientid` = c.`clientid`
			WHERE i.`deleted`=0 AND i.`invoicedate` BETWEEN $startdate AND $enddate
			ORDER BY `invoiceid` DESC;
		ELSE
			SELECT `invoiceid`,
			CASE WHEN `oldinvoiceno` IS NULL THEN `invoiceno` 
			ELSE `oldinvoiceno` 
			END AS invoiceno
			/*`invoiceno`*/,DATE_FORMAT(`invoicedate`,'%d-%b-%Y') `invoicedate`, i.`clientid`,`currency`,`rate`, 
			c.`clientname`,c.`address`,
			IFNULL((SELECT CASE WHEN tax=1 THEN SUM(amount)+ SUM(amount*0.16) ELSE SUM(amount) END
			FROM `invoicedetails` WHERE invoiceid=i.invoiceid GROUP BY tax),0) amount
			FROM `invoices` AS i INNER JOIN `clients` AS c ON i.`clientid` = c.`clientid`
			WHERE i.`deleted`=0 AND i.`clientid`=$clientid AND i.`invoicedate` BETWEEN $startdate AND $enddate
			ORDER BY `invoiceid` DESC;
		END IF;			
	END IF;
		
    
END */$$
DELIMITER ;

