/* Procedure structure for procedure `sp_getinvoicedetails` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_getinvoicedetails` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_getinvoicedetails`(IN `$invoiceid` INT)
BEGIN
	/*SELECT i.`invoiceid`,`invoiceno`,`invoicedate`,i.`currency`,i.`rate`,i.`dateadded`,i.`clientid`,c.`clientname`,
	c.`address`,c.`telephone`,CASE WHEN tax=1 THEN id.`amount`+(id.`amount`*taxrate/100) ELSE id.`amount` END amount ,id.`deliveryorderno`,a.`particular`,a.`containernumber`,
	a.`destination`,`trucknumber`,currencyname
	FROM `invoices` AS i
	JOIN `clients` AS c ON i.`clientid` = c.`clientid`
	INNER JOIN `invoicedetails` AS id ON i.`invoiceid` = id.`invoiceid`
	INNER JOIN `allocations` AS a ON a.`deliveryorderno`=id.`deliveryorderno`
	INNER JOIN `allocationdetails` ad ON ad.`allocationid`=a.`allocationid`
	INNER JOIN `vehicles` AS v ON v.`vehicleid`=ad.`truckid`
	INNER JOIN `currency` AS cu ON cu.`currencyid` = i.`currency`
	WHERE i.`deleted`=0 AND i.`invoiceid` = $invoiceid
	ORDER BY i.`invoiceid` DESC, i.`dateadded` DESC;*/
	
	
	SELECT  i.`invoiceid`, `invoiceno`,
	CASE WHEN `oldinvoiceno` IS NULL THEN `invoiceno` 
	ELSE `oldinvoiceno` 
	END AS invoiceno,`invoicedate`,i.`currency`,id.`amount`,`invoicedate`,i.`currency`,id.`amount`,
	IFNULL((SELECT SUM(`amount`) FROM `invoicedetails` WHERE invoiceid=i.invoiceid),0) subtotal,
	IFNULL((SELECT CASE WHEN tax=1 THEN SUM(amount*`taxrate` / 100) ELSE 0 END FROM `invoicedetails` WHERE invoiceid=i.invoiceid GROUP BY tax),0) vat,
	IFNULL((SELECT CASE WHEN tax=1 THEN SUM(amount)+ SUM(amount*0.16) ELSE SUM(amount) END FROM `invoicedetails` WHERE invoiceid=i.invoiceid GROUP BY tax),0) total_amount,
	CASE WHEN id.`tax` = 1 THEN id.`tax` ELSE 0 END AS tax,
	i.`dateadded`, i.`clientid`,c.`clientname`, a.`destination`, c.`telephone`,id.`deliveryorderno`,a.`particular`,a.`containernumber`,a.`destination`,
	`trucknumber`,currencyname, a.`deliveryorderno`,`rate`,1 qty,c.`address`
	FROM `invoices` AS i
	JOIN `clients` AS c ON i.`clientid` = c.`clientid`
	INNER JOIN `invoicedetails` AS id ON i.`invoiceid` = id.`invoiceid`
	INNER JOIN `allocations` AS a ON a.`deliveryorderno` = id.`deliveryorderno`
	INNER JOIN `allocationdetails` ad ON ad.`allocationid` = a.`allocationid`
	INNER JOIN `vehicles` AS v ON v.`vehicleid` = ad.`truckid`
	INNER JOIN `currency` AS cu ON cu.`currencyid` = i.`currency`
	WHERE i.`deleted` = 0 
	AND i.`invoiceid` = $invoiceid
	ORDER BY i.`invoiceid` DESC, i.`dateadded` DESC;
    
    END */$$
DELIMITER ;

