/* Procedure structure for procedure `sp_getothertransactiondetails` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_getothertransactiondetails` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_getothertransactiondetails`(IN `$branchid` INT, IN `$transactiontype` VARCHAR(50))
BEGIN

    IF $branchid = 0 THEN 

        IF $transactiontype = 'tenants' THEN 

            SELECT `tenantid`,`tenantno`,CONCAT(`firstname`,' ',`middlename`,' ',`lastname`) AS tenantname

            FROM `tenants` 

            WHERE `deleted` = 0;

            

        ELSEIF $transactiontype='landlords' THEN 

            SELECT `ownerid`,`landlordno`,`name`

            FROM `propertyowners` po

            WHERE po.`deleted` = 0 

              AND `ownerid` IN (SELECT `ownerid`FROM `propertyattached` WHERE `deleted` = 0 AND `detached` = 0);

              

        ELSEIF $transactiontype='staffs' THEN 

            SELECT `employeeid`,`staffno`, CONCAT(`firstname`,' ',`middlename`,' ',`lastname`) AS employeename

            FROM `employeerecords`

            WHERE `onpayroll`=1 AND `status` = 'Active';

            

        ELSEIF $transactiontype='creditors' THEN 

            SELECT `supplierid`,`supplierno`,`suppliername`

            FROM `creditors`

            WHERE `deleted` = 0;

        END IF;

        

    ELSE

        IF $transactiontype='tenants' THEN 

            SELECT `tenantid`,`tenantno`,CONCAT(`firstname`,' ',`middlename`,' ',`lastname`) AS tenantname

            FROM `tenants` 

            WHERE `deleted` = 0 AND `branchid` =$branchid;

              

        ELSEIF $transactiontype='landlords' THEN 

            SELECT `ownerid`,`landlordno`,`name`

            FROM `propertyowners` po

            WHERE po.`deleted` = 0 AND `ownerid` IN (SELECT `ownerid`  FROM `propertyattached`  WHERE `deleted` = 0 AND `detached` = 0)

              AND `branchid` =$branchid;

              

        ELSEIF $transactiontype='staffs' THEN 

            SELECT `employeeid`,`staffno`,CONCAT(`firstname`,' ',`middlename`,' ',`lastname`) AS employeename

            FROM `employeerecords`

            WHERE `onpayroll`=1 AND `status` = 'Active' /* AND `branchid` =$branchid*/;

              

        ELSEIF $transactiontype='creditors' THEN 

            SELECT `supplierid`,`supplierno`,`suppliername`

            FROM `creditors`

            WHERE `deleted` = 0 AND `branchid` =$branchid;

        END IF;

    END IF;

END */$$
DELIMITER ;

