/* Procedure structure for procedure `sp_getprofitandlossreport` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_getprofitandlossreport` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_getprofitandlossreport`(IN `$startdate` DATE, IN `$enddate` DATE)
BEGIN

    DECLARE $cutoffdate DATE;

    -- Get cutoff date from parameters

    SET $cutoffdate = (SELECT DATE_FORMAT(`cutoffdate`,'%Y-%m-%d') 

                        FROM `startingparameters` LIMIT 1);

    -- Profit & Loss = Income + Expenses

    SELECT 

        a.`accountcode`,

        a.`accountname`,

        c.`classname` AS `accountclass`,

        -- Opening Balance (before startdate)

        IFNULL((SELECT SUM(IFNULL(t2.debit,0)-IFNULL(t2.credit,0))

                FROM `gltransactions` t2

                WHERE t2.glaccount = a.id 

                AND DATE_FORMAT(t2.transactiondate,'%Y-%m-%d') 

                        BETWEEN $cutoffdate AND DATE_SUB($startdate, INTERVAL 1 DAY)),0) AS `openingbalance`,

        -- Debits in range

        IFNULL((SELECT SUM(IFNULL(t2.debit,0))

                FROM `gltransactions` t2

                WHERE t2.glaccount = a.id 

                AND DATE_FORMAT(t2.transactiondate,'%Y-%m-%d') 

                        BETWEEN $startdate AND $enddate),0) AS `debits`,

        -- Credits in range

        IFNULL((SELECT SUM(IFNULL(t2.credit,0))

                FROM `gltransactions` t2

                WHERE t2.glaccount = a.id 

                AND DATE_FORMAT(t2.transactiondate,'%Y-%m-%d') 

                        BETWEEN $startdate AND $enddate),0) AS `credits`,

        -- Closing Balance

        IFNULL((SELECT SUM(IFNULL(t2.debit,0)-IFNULL(t2.credit,0))

                FROM `gltransactions` t2

                WHERE t2.glaccount = a.id

                AND DATE_FORMAT(t2.transactiondate,'%Y-%m-%d') 

                        BETWEEN $cutoffdate AND $enddate),0) AS `closingbalance`

                

    FROM glaccounts a

    INNER JOIN glaccountgroups g ON a.groupid = g.id

    INNER JOIN glaccountclasses c ON g.glaccountclass = c.id

    WHERE c.classname IN ('Income','Expense') 

    ORDER BY c.classname, a.accountcode;

END */$$
DELIMITER ;

