/* Procedure structure for procedure `sp_getstatement` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_getstatement` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_getstatement`(IN `$clientid` INT, IN `$datefrom` DATE, IN `$dateto` DATE, IN `$statementcurrency` INT)
SELECT 'Bal B/f' AS TYPE,clientid, `clientname`, `address`, `telephone`,DATE_SUB($datefrom, INTERVAL 1 DAY) AS transactdate,
	-- ifnull((select sum(`amount`) from `invoicedetails` id inner join `invoices` i on i.`invoiceid`=id.`invoiceid` where `deleted`=0 and `clientid`=c.`clientid`),0) invoices,
	-- IFNULL((SELECT SUM(`amount`) FROM `receiptdetails` rd INNER JOIN `receipts` r ON r.`receiptid`=rd.`receiptid` WHERE `deleted`=0 AND `clientid`=c.`clientid`),0) payments,
	IFNULL((SELECT SUM(`amount`)+SUM(`amount`*taxrate/100)  FROM `invoicedetails` id INNER JOIN `invoices` i ON i.`invoiceid`=id.`invoiceid` WHERE `deleted`=0 AND `clientid`=c.`clientid` AND `tax`=1 AND `invoicedate`<$datefrom),0) +
	IFNULL((SELECT SUM(`amount`) FROM `invoicedetails` id INNER JOIN `invoices` i ON i.`invoiceid`=id.`invoiceid` WHERE `deleted`=0 AND `clientid`=c.`clientid` AND `tax`=0 AND `invoicedate`<$datefrom),0) -
	IFNULL((SELECT SUM(`amount`) FROM `receiptdetails` rd INNER JOIN `receipts` r ON r.`receiptid`=rd.`receiptid` WHERE `deleted`=0 AND `clientid`=c.`clientid` AND `receiptdate`<$datefrom),0) amount,
	'Bal B/f' AS naration,'Previous Balance' AS Ref 
	FROM clients c WHERE `deleted`=0 AND `clientid`=$clientid
	
	UNION
	
	SELECT 'Invoice' AS TYPE, i.`clientid`,`clientname`,`address`,`telephone`,`invoicedate` AS transactdate,
	IFNULL((SELECT CASE `tax` WHEN 1 THEN SUM(`amount`)+SUM(`amount`*taxrate/100) ELSE SUM(`amount`) END FROM `invoicedetails` WHERE `invoiceid` = i.`invoiceid` GROUP BY `tax`),0) amount,
	'' AS narration, CONCAT('Invoice # - ',CASE WHEN i.`oldinvoiceno` IS NULL THEN i.`invoiceno` ELSE i.`oldinvoiceno` END) AS Ref
	FROM `invoices` AS i INNER JOIN `invoicedetails` AS id ON id.`invoiceid` = i.`invoiceid` INNER JOIN `clients` c ON c.`clientid`=i.`clientid`
	WHERE i.`deleted` = 0 AND `invoicedate` BETWEEN $datefrom AND $dateto AND i.`clientid`=$clientid -- AND i.`currency`=$statementcurrency
	
	UNION
	
	SELECT 'Payments',r.`clientid`,`clientname`,`address`,`telephone`,`receiptdate`,-1*(rd.`amount`),'payment received. Thank you',CASE WHEN `modeofpayment`='Cash' THEN 'Cash' ELSE `reference` END 
	FROM `receipts` AS r
	INNER JOIN `receiptdetails` AS rd ON rd.`receiptid`=r.`receiptid` INNER JOIN `clients` c ON c.`clientid`=r.`clientid`
	WHERE r.`deleted` = 0 AND `receiptdate` BETWEEN $datefrom AND $dateto AND r.`clientid`=$clientid 
	ORDER BY transactdate */$$
DELIMITER ;

