/* Procedure structure for procedure `sp_gettrialbalance` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_gettrialbalance` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_gettrialbalance`(`$startdate` DATETIME, `$enddate` DATETIME)
BEGIN

	-- SET @startdate=$startdate,@enddate=$enddate;

	SELECT IFNULL(CONCAT(accountcode,' - ',accountname),'TOTAL') accountname, 

		SUM(IF(`total`>0,`total`,0)) AS debit,

		SUM(IF(`total`<0,ABS(`total`),0)) AS credit FROM

	(SELECT `accountcode`,`accountname`,

	SUM(`debit`-`credit`) AS `total`

	FROM `glaccounts` g, `gltransactions` t

	WHERE g.`id`=t.`glaccount`  AND DATE_FORMAT(`transactiondate`,'%Y-%m-%d') BETWEEN $startdate AND $enddate AND t.`valid`=1

	GROUP BY `accountcode`,`accountname` ORDER BY `accountcode` ) tab1

	GROUP BY accountname

	WITH ROLLUP;

    END */$$
