/* Procedure structure for procedure `sp_saveallocatedexpenses` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_saveallocatedexpenses` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_saveallocatedexpenses`(`$refno` VARCHAR(50), `$allocationid` INT, `$userid` INT)
BEGIN

		START TRANSACTION;

			-- Delete existing expenses to be replaced with newly inserted values

			delete from `allocatedexpenses` where `allocationid`=$allocationid;

			

			-- Add the newly added expenses

			INSERT INTO `allocatedexpenses`(`allocationid`,`expenseid`,`amount`,`addedby`,`dateadded`)

			SELECT $allocationid,`expenseid`,`amount`,$userid,NOW() 

			FROM `tempallocatedexpenses` WHERE `refno`=$refno;

			

			/*-- Add Audit trail

			SELECT @narration=CONCAT('Created new allocation for order #',$deliveryno);*/

			

			-- Remove data fom temporary table

			DELETE FROM `tempallocatedexpenses`

			WHERE `refno`=$refno;

		COMMIT;

    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_saveallocatedvehicle` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_saveallocatedvehicle` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_saveallocatedvehicle`(`$allocationid` INT, IN `$deliverytype` VARCHAR(50), `$truckno` INT, `$driverid` INT, `$route` VARCHAR(50), `$destination` VARCHAR(50), `$kilometers` INT, `$dateout` DATE, `$expecteddatein` DATE, `$clientid` INT, `$particular` VARCHAR(50), `$containerid` INT, `$containernumber` VARCHAR(50), `$others` VARCHAR(50), `$amount` NUMERIC(18,2), `$currency` VARCHAR(50), `$exchangerate` NUMERIC(18,2), `$remarks` VARCHAR(1000), `$userid` INT, `$newdriverid` INT, `$newdriverstatus` VARCHAR(50), `$newvehicleid` INT, `$newvehiclestatus` VARCHAR(50), `$newremarks` VARCHAR(1000), `$updated` INT)
BEGIN

	    DECLARE $deliveryno VARCHAR(50);

	    DECLARE $allocateid INT;

	    DECLARE $newdateout DATETIME;

	    DECLARE $newexpecteddate DATETIME;

	    

	    START TRANSACTION;

    

		IF $allocationid = 0 THEN

			-- Generate delivery note number

			SELECT `fn_generatedeliveryno`() INTO $deliveryno;

			

			-- Add delivery allocation details

			INSERT INTO `allocations`(`deliveryorderno`,`deliverytype`,`route`,`destination`,`kilometers`,`clientid`,`particular`,

			`containerid`,`containernumber`,`others`,`amount`,`currency`,`exchangerate`,`remarks`,`dateadded`,`addedby`)

										

			VALUES($deliveryno,$deliverytype,$route, $destination, $kilometers, $clientid, $particular, $containerid, $containernumber, $others, $amount, 

			       $currency, $exchangerate,$remarks,now(),$userid);

			

			-- Get generated allocationid

			SELECT MAX(allocationid) FROM `allocations` INTO $allocateid;

			

			INSERT INTO `allocationdetails` (`allocationid`,`driverid`,`driverstatus`,`truckid`,`truckstatus`,`dateout`,`expecteddate`,`updatedby`,`dateupdated`)

			VALUES($allocateid, $driverid, 'Not Available', $truckno, 'In Transit',$dateout,$expecteddatein,$userid, NOW());

			

			-- Increment counter

			UPDATE `serials` SET `currentno`=`currentno`+1 WHERE `documentid`=1;

		ELSE

			SELECT `deliveryorderno` INTO $deliveryno FROM `allocations` WHERE `allocationid`=$allocationid limit 1;

	

			IF $updated = 0 THEN

			    -- Update all tables

			    UPDATE `allocations` SET `route`=$route, `destination`=$destination,`kilometers`=$kilometers,`clientid`=$clientid,`particular`=$particular,

			    `containerid`=$containerid,`containernumber`=$containernumber,`others`=$others,`amount`=$amount,`currency`=$currency,`exchangerate`=$exchangerate,

			    `deliverytype`=$deliverytype

			    WHERE `allocationid`=$allocationid;

			    

			    UPDATE `allocationdetails` 

			    SET `driverid`=$driverid,`truckid`=$truckno,`statusremarks`=$remarks,`dateout`=$dateout,`expecteddate`=$expecteddatein

			    WHERE `allocationid`=$allocationid;

			    

			ELSEIF $updated = 1 THEN

			    SELECT `dateout`,`expecteddate` INTO $newdateout, $newexpecteddate 

			    FROM allocationdetails WHERE `allocationid`=$allocationid 

			    limit 1;

			    

			    -- SELECT  INTO FROM allocationdetails WHERE `allocationid`=$allocationid;

			    INSERT INTO `allocationdetails` (`allocationid`,`driverid`,`driverstatus`,`truckid`,`truckstatus`,`updatedby`,`dateupdated`,`statusremarks`)

			    VALUES($allocationid, $newdriverid, $newdriverstatus, $newvehicleid, $newvehiclestatus,$userid, NOW(), $newremarks);

			END IF;

		END IF;

    

			    -- Return delivery note number generated

			    SELECT $deliveryno AS `deliveryno`;

    

    COMMIT;

END */$$
DELIMITER ;

