DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_saveaudittrailentry`(`$userid` INT, `$operation` VARCHAR(100), `$narration` VARCHAR(5000), `$platform` VARCHAR(1000), `$previousvalues` VARCHAR(5000), `$currentvalues` VARCHAR(5000))
BEGIN

