/* Procedure structure for procedure `sp_savechargeableitem` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_savechargeableitem` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_savechargeableitem`(`$itemid` INT, `$itemname` VARCHAR(100), `$amount` DECIMAL(18,2), `$visible` BOOL, `$userid` INT, `$platform` VARCHAR(1000))
BEGIN

		start transaction;

			if $itemid=0 then 

				insert into `chargeableitems`(`itemname`,`amount`,`visible`,`dateadded`,`addedby`)

				values($itemname,$amount,$visible,now(),$userid);

				select max(`itemid`) into $itemid from `chargeableitems`;

				

				set @narration=concat('Created new chargeable item item id:',$itemid,' item name: ',$itemname);

				CALL `sp_saveaudittrailentry`($userid,'insert',@narration,$platform,'',''); 

			else

				CALL `sp_gettabledata`('chargeableitems','itemid',$itemid,@originalvalues);

				

				UPDATE `chargeableitems`

				set `itemname`=$itemname,`amount`=$amount,`visible`=$visible

				where `itemid`=$itemid;

				

				CALL `sp_gettabledata`('chargeableitems','itemid',$itemid,@currentvalues);

				

				SELECT CONCAT('Updated chargeable item details for item id: ',$itemid) 

				INTO @narration;

				

				IF @originalvalues!=@currentvalues THEN 

					CALL `sp_saveaudittrailentry`($userid,'update',@narration,$platform,@originalvalues,@currentvalues);

				END IF;

			end if;

		commit;

	END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_saveclients` */

