DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_saveclients`(`$clientid` INT, `$clientname` VARCHAR(50), `$address` VARCHAR(50), `$telephone` VARCHAR(50), `$contactperson` VARCHAR(50))
BEGIN

	IF $clientid = 0 THEN

		INSERT INTO `clients`(`clientname`,`address`,`telephone`,`contactperson`,`addedby`)

		VALUES($clientname, $address, $telephone, $contactperson, 1);

	ELSE

		UPDATE `clients`

		SET `clientname`=$clientname, `address`=$address, `telephone`=$telephone, `contactperson`=$contactperson

		WHERE `clientid`=$clientid;

	END IF;

    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_savecontainerdeliverystatus` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_savecontainerdeliverystatus` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_savecontainerdeliverystatus`(in $statusid int,in $allocationid int,in $containerdeportid int,in $cargodeliverystatus varchar(50),in $returndeportstatus varchar(50),in $qurantee varchar(50),in $deliveryinterchange varchar(50),
  in $clientinterchange varchar(50),in $userid int)
BEGIN
		if $statusid = 0 then 
			insert into `allocationstatus`(`allocationid`,`containerdeportid`,`cargodeliverystatus`,`returndeportstatus`,`qurantee`,`deliveryinterchange`,`clientinterchange`,`dateadded`,`addedby`)
			values($allocationid,$containerdeportid,$cargodeliverystatus,$returndeportstatus,$qurantee,$deliveryinterchange,$clientinterchange,now(),$userid);
			
			-- selecting max id
			select max(`statusid`)
			into $statusid from `allocationstatus`;
			
			-- giving out narration but not saving it
			select concat("Added new inetrchange status statusid:",$statusid)
			into @narration;
			
	       else
	             -- just incase of updating the status
	             update `allocationstatus`
	             set`allocationid` = $allocationid,`containerdeportid`=$containerdeportid,`cargodeliverystatus`=$cargodeliverystatus,`returndeportstatus`=$returndeportstatus,`qurantee`=$qurantee,
	             `deliveryinterchange`= $deliveryinterchange,`clientinterchange`= $clientinterchange
	             where `statusid` = $statusid;
	             
	             -- giving  aout narration after the update but not saving it
	             SELECT CONCAT("updated inetrchange status, statusid:",$statusid)
		     INTO @narration;
	    end if;
		     
		     
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_savecontainerdeportname` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_savecontainerdeportname` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_savecontainerdeportname`(in $deportid int,in $deportname varchar(50))
BEGIN
          if $deportid = 0 then 
		insert into `containerdepot`(`deportname`)
		values($deportname);
		
		-- selecting max id
		select max(`deportid`) 
		into $deportid
		from `containerdepot`;
		
		-- giving out narration
		select concat("Added new container deport name deportid:",$deportid)
		into @narrations;
		
	   else
	         
	         update `containerdepot`
	         set `deportname` = $deportname
	         where `deportid` = $deportid;
	         
	         -- giving out nattaion
	        SELECT CONCAT("Updated container deport name deportid:",$deportid)
		INTO @narrations;
		
	  end if;
    END */$$
DELIMITER ;

