/* Procedure structure for procedure `sp_savefinancialperiod` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_savefinancialperiod` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_savefinancialperiod`(`$id` INT, `$label` VARCHAR(50), `$startdate` DATE, `$enddate` DATE, `$currentperiod` BOOL, `$userid` INT, `$platform` VARCHAR(1000), `$branchid` INT)
BEGIN

	if $id=0 then

	

		insert into `financialperiods`(`label`,`startdate`,`enddate`,`current`,`dateadded`,`addedby`,`deleted`)

		values($label,$startdate,$enddate,$currentperiod,now(),$userid,0);

		set @narration=concat('Created financial period ',$label,' date range ',$startdate,' - ',$enddate);

		CALL `sp_saveaudittrailentry`($userid,'Insert',@narration,$platform,'','',$branchid);

	else

		CALL `sp_gettabledata`('financialperiods','id',$id,@originalvalues); 

		

		update `financialperiods` 

		set `label`=$label,`startdate`=$startdate,`enddate`=$enddate,`current`=$currentperiod

		where `id`=$id;

	

		CALL `sp_gettabledata`('financialperiods','id',$id,@newvalues); 

		

		set @narration=CONCAT('Updated financial period details for ',$label,' id: ',$id,'  date range ',date_format($startdate,'%d-%b-%Y'),' - ',date_format($enddate,'%d-%b-%Y'));

		IF @originalvalues!=@newvalues THEN 

			CALL `sp_saveaudittrailentry`($userid,'Update',@narration,$platform,@originalvalues,@newvalues);

		END IF;

	

	end if;

    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_saveglaccount` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_saveglaccount` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_saveglaccount`(`$id` INT, `$groupid` INT, `$accountcode` VARCHAR(50), `$accountname` VARCHAR(50), `$isbankaccount` BOOL, `$allowoverdraft` BOOL, `$bankname` VARCHAR(50), `$branchname` VARCHAR(50), `$accountno` VARCHAR(50), `$swiftcode` VARCHAR(50), `$userid` INT, `$platform` VARCHAR(1000))
BEGIN

	if $id=0 then 

	

		insert into `glaccounts`(`groupid`,`accountcode`,`accountname`,`dateadded`,`addedby`,`deleted`,`isbankaccount`,`allowoverdraft`,`bankname`,`branchname`,`accountno`,`swiftcode`)

		values($groupid,$accountcode,$accountname,now(),$userid,0,$isbankaccount,$allowoverdraft,$bankname,$branchname,$accountno,$swiftcode);

		

		-- Add audit trail entry

		select concat('Created new general ledger account ',$accountcode,' - ',$accountname) 

		into @narration;

		

		CALL `sp_saveaudittrailentry`($userid,'Insert',@narration,$platform,'','');

		

	else

		

		CALL `sp_gettabledata`('glaccounts','id',$id,@originalvalues);

		

		update `glaccounts` set `groupid`=$groupid, `accountcode`=$accountcode,`accountname`=$accountname,`isbankaccount`=$isbankaccount,

		`allowoverdraft`=$allowoverdraft,`bankname`=$bankname,`branchname`=$branchname,`accountno`=$accountno,`swiftcode`=$swiftcode,

		`lastdateupdated`=now(),`lastupdatedby`=$userid where `id`=$id;

		CALL `sp_gettabledata`('glaccounts','id',$id,@currentvalues);

		

		select concat('Updated general account details for ',$accountcode,' - ',$accountname) 

		into @narration;

		

		if @originalvalues<>@currentvalues then 

			CALL `sp_saveaudittrailentry`($userid,'Update',@narration,$platform,@originalvalues,@currentvalues);

		end if;

	end if;

    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_saveglaccountmapping` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_saveglaccountmapping` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_saveglaccountmapping`(`$category` VARCHAR(50), `$itemid` INT, `$glaccountid` INT, `$userid` INT, `$platform` VARCHAR(1000), `$branchid` INT)
BEGIN

    

	if $category='Registration' then 

		SET @activitydescription='Registration';

	elseif $category='Deposits' then

		set @activitydescription='Deposits';

	elseif $category='Savings' then

		select `savingname` into @activitydescription from `savingtypes` where `id`=$itemid;

	elseif $category='Shares' then

		select `sharename` into @activitydescription from `sharetypes` where `sharetypeid`=$itemid;

	elseif $category='Loans' then

		select `loanname` INTO @activitydescription from `loantypes` where `loanid`=$itemid;

	elseif $category='Loan Charges' then

		select `chargedescription`  INTO @activitydescription from `loanapplicablecharges` where `applicablechargeid`=$itemid;

	elseif $category='Interest' then

		set  @activitydescription='Interest';

	end if;

	

	if not exists(select * from `accountmapping` where `category`=$category and `itemid`=$itemid) then

	

		insert into `accountmapping`(`category`,`itemid`,`glaccountid`,`dateadded`,`addedby`)

		values($category,$itemid,$glaccountid,now(),$userid);

		

		select concat('Added account mapping for ',@activitydescription,' - ',`accountname`)

		into @narration from `glaccounts` where `id`=$glaccountid;

		

		CALL `sp_saveaudittrailentry`($userid,'Insert',@narration,$platform,'','');

	

	else

	

		update `accountmapping` 

		set `glaccountid`=$glaccountid

		WHERE `category`=$category AND `itemid`=$itemid;

		

		select  concat('Updated account mapping for ',@activitydescription,' - ',accountname)

		into @narration

		from glaccounts where id=$glaccountid;

		

		CALL `sp_saveaudittrailentry`($userid,'Update',@narration,$platform,'','',$branchid);

		

	end if;

	

    END */$$
DELIMITER ;

