/* Procedure structure for procedure `sp_saveglsubaccountbank` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_saveglsubaccountbank` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_saveglsubaccountbank`(`$id` INT, `$bankid` INT, `$branchid` INT, `$accountnumber` VARCHAR(50), `$addedby` INT)
BEGIN

    DECLARE results INT;

    DECLARE $newid INT;

    SELECT IFNULL(MAX(id), 0) INTO $newid FROM `glsubaccounts`;

    SELECT COUNT(*) INTO results FROM `glsubaccountsbanks` WHERE `id` = $id;

    IF results = 0 THEN

        INSERT INTO `glsubaccountsbanks`(`id`, `bankid`, `branchid`, `accountnumber`, `addedby`)

        VALUES($newid, $bankid, $branchid, $accountnumber, $addedby);

    ELSE

        UPDATE `glsubaccountsbanks`

        SET `bankid` = $bankid, `branchid` = $branchid, `accountnumber` = $accountnumber, `addedby` = $addedby

        WHERE `id` = $id;

    END IF;

END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_saveglsubaccounts` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_saveglsubaccounts` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_saveglsubaccounts`(`$id` INT, `$accountcode` VARCHAR(50), `$subaccountname` VARCHAR(50))
BEGIN

    -- DECLARE exist INT;

    DECLARE glsubaccountcode VARCHAR(50);

    declare newid int;

      

    SELECT COALESCE(MAX(id), 0) + 1 INTO newid FROM `glsubaccounts`;

    

    -- Generate the subaccountcode by concatenating the accountcode and id with leading zeros

    SET glsubaccountcode = CONCAT($accountcode, 'SA', LPAD(newid, 2, '0'));

    -- If the record does not exist, insert a new one into glsubaccounts

    IF $id = 0 THEN

        INSERT INTO `glsubaccounts` (id, accountcode, subaccountcode, subaccountname)

        VALUES ($id, $accountcode, glsubaccountcode, $subaccountname);

               

        

    ELSE

        -- If the record exists, update the existing record

        UPDATE `glsubaccounts`

        SET accountcode = $accountcode, subaccountcode = glsubaccountcode, subaccountname = $subaccountname

        WHERE id = $id;

    END IF;

END */$$
DELIMITER ;

