/* Procedure structure for procedure `sp_saveinvoices` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_saveinvoices` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_saveinvoices`($refno varchar(100),$clientid INT,$invoicedate DATE,$oldinvoiceno varchar(50),$userid int)
BEGIN	
	DECLARE $invoiceid INT;
	declare $invoiceno varchar(50);
	declare $deliveryorderno VARCHAR(50);
	declare $amount DECIMAL(18, 2);
	declare $tax TINYINT(1);
	
	select `fn_generateinvoiceno`() into $invoiceno;
	
	START TRANSACTION;
	
		INSERT INTO `invoices`(`invoiceno`,`clientid`, `invoicedate`,`oldinvoiceno`,`addedby`)
		VALUES($invoiceno,$clientid,$invoicedate,$oldinvoiceno,$userid);
		
		 -- Get generated invoiceid
		select max(`invoiceid`) from `invoices` into $invoiceid;
		
		-- insert into invoice details
		insert into `invoicedetails` (`invoiceid`,`deliveryorderno`,`amount`,`tax`) 
		select $invoiceid,`deliveryorderno`,`amount`,`tax`
		from `tempinvoices` 
		WHERE `refno`=$refno;
		
		update `serials` set `currentno` = `currentno`+1 
		where `documentid` = 2;
		
		update `allocations` set `invoiced` = 1 
		where `deliveryorderno` in (select `deliveryorderno`
		FROM `tempinvoices` 
		WHERE `refno`=$refno);  
		
		-- DELETE Temp
		delete from `tempinvoices` 
		WHERE `refno`=$refno;
		
	    /*ELSE
		-- Add logic here to handle existing invoices (e.g., update)
		UPDATE `invoices`
		SET `clientid` = $clientid, `deliveryorderno` = $deliveryorderno, `invoicedate` = $invoicedate, `totalamount` = $totalamount, `tax` = $tax
		WHERE `invoiceid` = $invoiceid;
	    END IF;*/
	    
	    -- select $invoiceid as invoiceid,$refno refno;
	COMMIT;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_savejournaltransaction` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_savejournaltransaction` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_savejournaltransaction`(`$refno` VARCHAR(50), `$referenceno` VARCHAR(50), `$description` VARCHAR(100), `$journaldate` DATETIME, `$addtoledger` BIT, `$userid` INT, `$platform` VARCHAR(1000))
BEGIN

	declare $journalid int;

	declare $journalno varchar(50);

	

	start transaction;

	

		-- generate journal number

		seLECT `fn_generatejournalno`() INTO $journalno;

		

		-- insert the journal details

		insert into `journals`(`journalno`,`referenceno`,`date`,`description`,`addedby`,`addedtoledger`,`branchid`)

		values($journalno,$referenceno,now(),$description,$userid,$addtoledger,1);

		

		-- get the journal id

		set $journalid=(select max(`id`) from `journals`);

		

		-- post journal transactions

		insert into `journaldetails`(`journalid`,`glaccount`,`narration`,`debit`,`credit`)

		select $journalid,`glaccount`,`narration`,`debit`,`credit` from `tempjournaldetails` where `refno`=$refno;

		

		-- post the info to the gl if requested

		if $addtoledger=1 then 

			insert into `gltransactions`(`referenceno`,`transactiondate`,`glaccount`,`glcontraaccount`,`narration`,`debit`,`credit`,`addedby`)

			select $referenceno,$journaldate,`glaccount`,`glcontra`,`narration`,`debit`,`credit`,$userid from `tempjournaldetails` where `refno`=$refno;

		end if;

		

		-- Add audit trail entry

		set @narration=concat('Created a journal entry journal no: ',$journalno,' description: ',$description,' id: ',$journalid);

		

		CALL `sp_saveaudittrailentry`($userid,'Insert',@narration,$platform,'','');

		

		-- Icrement journal number counter

		/*update `serialnumbers` set `currentno`=`currentno`+1 

		where `documentname`='Journal';*/

		

		 /*UPDATE `branches` 

		 SET `journalcurrentno`=`journalcurrentno`+1

		 WHERE `branchid`=$branchid;*/

		

		-- delete temp journal data

		delete from `tempjournaldetails` WHERE `refno`=$refno;

		

		-- return the generated journal id

		select $journalid as `journalid`;

		

	commit;

    END */$$
DELIMITER ;

