/* Procedure structure for procedure `sp_saveothertransaction` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_saveothertransaction` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_saveothertransaction`(IN `$refno` VARCHAR(50), IN `$transactionid` INT, IN `$transactintype` VARCHAR(50), IN `$description` VARCHAR(1000), IN `$reference` VARCHAR(50), IN `$transactiondate` DATE, IN `$paymentmodeid` INT, IN `$currencyid` INT, IN `$amount` DECIMAL(18,2), IN `$loanamount` DECIMAL(18,2), IN `$accountcreditedid` INT, IN `$subaccountid` INT, IN `$userid` INT, IN `$branchid` INT, IN `$platform` VARCHAR(1000))
BEGIN

         

         declare $othertransactiono varchar(50);

         

         if $transactionid = 0 then 

         

               -- gernrate other transaction number

               select `fn_generaothertransactionno`($branchid) into $othertransactiono;

         

                insert into `othertransactions`(`othertransactiono`,`transactiontype`,`description`,`reference`,`transactiondate`,`paymodeid`,`currencyid`,`amount`,`loanamount`,`acountcreditedid`,`subaccountid`,`dateadded`,`addedby`)

                values($othertransactiono,$transactintype,$description, $reference,$transactiondate,$paymentmodeid,$currencyid,$amount,$loanamount,$accountcreditedid,$subaccountid,now(),$userid);

                

                -- selecting max transaction id

                select max(`transactionid`)

                into $transactionid

                from `othertransactions`;

                

                -- givin aout narration

                select concat('Added new other transaction',$transactionid)

                into @narration

                from `othertransactions`

                where `transactionid` = $transactionid;

                

                UPDATE `branches` 

	        SET `othertransactionno`=`othertransactionno`+1

	        WHERE `branchid`=$branchid; 

                

                -- calling the save audit trail entry 

                CALL `sp_saveaudittrailentry`($userid,'deleted',@narration,$platform,'','',$branchid);

                

                

                

         else

             

                -- calling data dable before editing 

                CALL `sp_gettabledata`('othertransactions','transactionid',$transactionid,@originalvalues);

                

                -- updating the values

                update `othertransactions`

                set `transactiontype` = $transactintype,`description`= $description,`reference`=$reference,`transactiondate` = $transactiondate,`paymodeid`= $paymentmodeid,

                `currencyid` = $currencyid,`amount`=$amount,`loanamount` = $loanamount,`acountcreditedid`= $accountcreditedid = `subaccountid`= $subaccountid

                where `transactionid` = $transactionid;

                

                -- giving out narration 

                 SELECT CONCAT('Updated new other transaction',$transactionid)

                INTO @narration

                FROM `othertransactions`

                WHERE `transactionid` = $transactionid;

                

                -- calling the data table after the update

                CALL `sp_gettabledata`('othertransactions','transactionid',$transactionid,@currentvalues);

               

               -- comparing the current values with original values

               IF @originalvalues!=@currentvalues THEN 

			CALL `sp_saveaudittrailentry`($userid,'update',@narration,$platform,@originalvalues,@currentvalues,$branchid);

		END IF;

		

	 end if;

                

                

    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_savepaymentmode` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_savepaymentmode` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_savepaymentmode`(IN `$paymentmodeid` INT, IN `$modename` VARCHAR(50), `$requiref` BOOL, IN `$accountid` INT, IN `$userid` INT, IN `$platform` VARCHAR(1000))
BEGIN

          start transaction;

		  if $paymentmodeid = 0 then

			insert into `paymentmodes`(`paymentmodename`,`requiresref`,`account`,`dateadded`,`addedby`)

			values($modename,$requiref,$accountid,now(),$userid);

			

			

			-- giving out narration

			select max(`paymentmodeid`) into $paymentmodeid

			from `paymentmodes`;

			

			-- giving out narration

			select concat('Added new payment mode paymentmodeid',$paymentmodeid)

			into @narration

			from `paymentmodes` where `paymentmodeid` = $paymentmodeid;

			

			-- calling the save audit trail

			CALL `sp_saveaudittrailentry`($userid,'insert',@narration,$platform,'','');

			

		else 

		     -- calling the table data

		      CALL `sp_gettabledata`('paymentmodes','paymentmodeid',$paymentmodeid,@originalvalues);

		      

		      -- updating the table

		      update  `paymentmodes`

		      set `paymentmodename`=$modename,`requiresref` = $requiref,`account` = $accountid

		      where `paymentmodeid` = $paymentmodeid;

		      

		      -- giving out narration

		      select concat('update the payment mode id',$paymentmodeid)

		      into @narration

		      from `paymentmodes`

		      where `paymentmodeid` = $paymentmodeid;

		      CALL `sp_gettabledata`('paymentmodes','paymentmodeid',$paymentmodeid,@currentvalues);

		      

		      IF @originalvalues!=@currentvalues THEN 

		      

				CALL `sp_saveaudittrailentry`($userid,'update',@narration,$platform,@originalvalues,@currentvalues);

		      END IF;

		      

	       end if;  

          commit;

    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_savepaymentvoucher` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_savepaymentvoucher` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_savepaymentvoucher`(`$voucherid` INT, `$payeename` VARCHAR(50), `$DESCRIPTION` VARCHAR(1000), `$paymentmode` INT, `$refference` VARCHAR(100), `$amount` NUMERIC, `$crledger` VARCHAR(50), `$subaccount` VARCHAR(50), `$transactiondate` DATETIME, `$userid` INT, `$branchid` INT)
BEGIN

    DECLARE voucherno VARCHAR(50);

    DECLARE drledger VARCHAR(50);

    -- Check if the voucher already exists by voucherid

    IF $voucherid IS NOT NULL AND $voucherid > 0 THEN

        -- If voucher exists, update it

        UPDATE `paymentvoucher`

        SET 

            `payeename` = $payeename,

            `DESCRIPTION` = $DESCRIPTION,

            `paymentmode` = $paymentmode,

            `refference` = $refference,

            `amount` = $amount,

            `transactiondate` = $transactiondate,

            `addedby` = $userid,

            `branchid` = $branchid

        WHERE `voucherid` = $voucherid;

        -- Update paymentvoucherdetails table

        UPDATE `paymentvoucherdetails`

        SET 

            `invoiceno` = $refference,

            `DESCRIPTION` = $DESCRIPTION,

            `amount` = $amount,

            `crledger` = $crledger

        WHERE `voucherid` = $voucherid;

    ELSE

        -- If voucher doesn't exist, create a new voucher

        -- Generate voucher number using the function

        SELECT `fn_generatevoucherno`() INTO voucherno;

        -- Insert into paymentvoucher table (voucherid will be auto-generated by MySQL)

        INSERT INTO `paymentvoucher`(`voucherno`, `payeename`, `DESCRIPTION`, `paymentmode`, `refference`, `amount`, `transactiondate`, `addedby`, `branchid`)

        VALUES(voucherno, $payeename, $DESCRIPTION, $paymentmode, $refference, $amount, $transactiondate, $userid, $branchid);

        -- Get the last inserted voucherid (auto-generated by MySQL)

        SET $voucherid = LAST_INSERT_ID();

        -- Insert into paymentvoucherdetails table (Temporary storage of payment details)

        INSERT INTO `paymentvoucherdetails`(`voucherid`, `invoiceno`, `DESCRIPTION`, `amount`, `crledger`)

        VALUES($voucherid, $refference, $DESCRIPTION, $amount, $crledger);

    END IF;

    -- Get the debit ledger account code based on the payment mode

    SELECT `accountcode` INTO drledger FROM `defaultaccounts` WHERE `paymentmode` = $paymentmode;

    -- Insert Debit Entry in Transaction table

    INSERT INTO `transaction`(`memo`, `dramount`, `drledger`, `crledger`, `transactiondate`, `addedby`, `narration`, `details`)

    VALUES(

        voucherno,

        $amount,

        drledger,

        $crledger,

        $transactiondate,

        $userid,

        CONCAT('Payment to ', $payeename, ' for invoice reference: ', $refference),

        $DESCRIPTION

    );

    -- Insert Credit Entry in Transaction table

    INSERT INTO `transaction`(`memo`, `cramount`, `drledger`, `crledger`, `subaccount`, `transactiondate`, `addedby`, `narration`, `details`)

    VALUES(

        voucherno,

        $amount,

        $crledger,

        drledger,

        $subaccount,

        $transactiondate,

        $userid,

        CONCAT('Payment to ', $payeename, ' for invoice reference: ', $refference),

        $DESCRIPTION

    );

END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_saveprivileges` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_saveprivileges` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_saveprivileges`(`$id` INT, `$category` VARCHAR(50), `$refno` VARCHAR(50), `$userid` INT)
BEGIN

	START TRANSACTION;

		IF $category='user' THEN 

			BEGIN

				-- delete all privileges

				DELETE FROM `userprivileges` WHERE `userid`=$id;

				-- add the ones from the temp table

				INSERT INTO `userprivileges` (`userid`,`objectid`,`allowed`,`addedby`,`lastupdatedby`,`lastdateupdated`)

				SELECT $id,`objectid`,`valid`,$userid,$userid,NOW() FROM `tempprivilege` WHERE `refno`=$refno;

			END;

		ELSE

			BEGIN

				-- delete all role privileges

				DELETE FROM `roleprivileges` WHERE `roleid`=$id;

				-- add new ones from the temp table

				INSERT INTO `roleprivileges`(`roleid`,`objectid`,`allowed`,`dateadded`,`addedby`)

				SELECT $id,`objectid`,`valid`,NOW(),$userid FROM `tempprivilege` WHERE `refno`=$refno; 

			END;

		END IF;

		-- Remove temporary data

		DELETE FROM `tempprivilege` WHERE `refno`=$refno;

	COMMIT;

    END */$$
DELIMITER ;

