/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_updateallocatedvehicle`(`$allocationid` INT, `$driverid` INT, `$driverstatus` VARCHAR(50), `$truckid` INT, `$truckstatus` VARCHAR(50), `$dateout` DATETIME, `$expecteddate` DATETIME, `$remarks` VARCHAR(50), `$userid` INT)
